# -*- coding: utf-8 -*-
'''
Unit testing for encrypt data
'''
import os
import unittest
from encrypt.encrypt_data_simple import encrypt_input_simple
from decrypt.decrypt_data_simple import decrypt_input_simple


class TestEncryptData(unittest.TestCase):
    '''
    Test the functions that are involved in encrypting the data
    '''
    def test_a_cleanup(self):
        test_enc_path = './tests/test_files/test_enc_file.txt'
        test_key_path = './tests/test_files/test_enc_key.txt'
        if os.path.isfile(test_enc_path):
            os.remove(test_enc_path)
        if os.path.isfile(test_key_path):
            os.remove(test_key_path)
        self.assertFalse(os.path.isfile(test_enc_path) and os.path.isfile(test_key_path))

