    def test_c_encrypting_file(self):
        '''
        Test that encrypting a file is possible
        '''
        test_file_path = './tests/test_files/test_file1.txt'
        test_enc_path = './tests/test_files/test_enc_file.txt'
        test_key_path = './tests/test_files/test_enc_key.txt'
        # read the file
        target_file = open(test_file_path, "r")
        file_data = target_file.read()
        target_file.close()
        # encrypt contents
        token, key = encrypt_input_simple(str(file_data))
        # save to drive
        enc_file = open(test_enc_path, "w")
        enc_file.write(token)
        enc_file.close()
        enc_file = open(test_key_path, "w")
        enc_file.write(key)
        enc_file.close()
        # check if the files exist
        self.assertTrue(os.path.isfile(test_enc_path) and os.path.isfile(test_key_path))


    def test_d_decrypting_file(self):
        '''
        Test that encrypting a file is possible
        '''
        test_file_path = './tests/test_files/test_file1.txt'
        test_enc_path = './tests/test_files/test_enc_file.txt'
        test_key_path = './tests/test_files/test_enc_key.txt'
        # read the files
        target_file = open(test_file_path, "r")
        original = target_file.read()
        target_file.close()
        target_file = open(test_enc_path, "r")
        data = target_file.read()
        target_file.close()
        target_file = open(test_key_path, "r")
        key = target_file.read()
        target_file.close()
        # decrypt the contents
        decrypted = decrypt_input_simple(data, key)
        # check if the strings match
        self.assertEqual(decrypted, original)


